function loadSeenOn(n){const e="contest-",{seenOn:t}=n;t.forEach(((n,t)=>{const a=`<div class="carousel-item col-md-3${0==t?" active":""}">\n                                <div class="panel panel-default">\n                                    <div class="panel-thumbnail">\n                                        <a target="_blank" href="https://${n.link}" class="thumb">\n                                            <picture>\n                                                <source\n                                                    srcset="../img/events/${e}${n.image}.webp"\n                                                    type="image/webp">\n                                                <source\n                                                    srcset="../img/events/${e}${n.image}.png" \n                                                    type="image/png">\n                                                <img src="../img/events/${e}${n.image}.png" alt="${n.title}" class="img-fluid mx-auto d-block">\n                                            </picture>\n                                        </a>\n                                    </div>\n                                </div>\n                            </div>`;document.getElementById("divEvents").innerHTML+=a}))}window.addEventListener("DOMContentLoaded",(n=>{let e=window.navigator.userLanguage||window.navigator.language,t="en-us/min";t=e.includes("es")?"es-sv/min":e.includes("zh")?"zh-zh/min":t;fetchData(`../js/data/translations/${t}/seenOn.json`).then((n=>{loadSeenOn(n)})).catch((n=>{console.error(n)}))}));